        reg_rdata_next[12:4] = command_1_txn_cnt_1_qs;
        reg_rdata_next[16:13] = command_1_dummy_cycles_1_qs;
        reg_rdata_next[25:17] = command_1_rx_cnt_1_qs;
        reg_rdata_next[26] = command_1_fulldplx_1_qs;
